import React from 'react';
import { Row, Col } from 'react-bootstrap';

const MypageModal = () => {

  return (
    <>
      <Row>
        <Col md={4}>
          <div>
            왼쪽
          </div>
        </Col>
        <Col md={8}>
          <div>
            오른쪽
          </div>
        </Col>
      </Row>
    </>
  );
}

export default MypageModal;
